import React from 'react'
import logo from '../assets/logo5.png';
function Menu() {
  return (
    <div className='Top'>
        <div className='Logo'>
            <img src={logo}></img>
        </div>
        <div className='Menu'>
            
        </div>
    </div>
  )
}

export default Menu;
